description:
The book Living Paleo for Dummies is a well written book that comprehensively covers paleo diet options. This book written by Melissa Joulawan and Dr. Kellyann Petrucci provides detail guidelines about various healthy paleo lifestyle options. For those with minimal or no information about this unique healthy lifestyle will find this book resourceful and helpful. Besides, this book offers an excellent reference point for nutritionist, dietician, medical students and clinical experts
